import styles from "./PostQuestion.module.scss";

const PostQuestion = () => {
    return <div>
        <form>
            <input type="text" />
            <div className={styles.choices}>
                <Choices defaultChoices="1" />
                <Choices defaultChoices="3" />
            </div>
        </form>
    </div>
}

export default PostQuestion;
